import { useEffect, useState } from 'react'

export const StaffList = () => { 

    const [staff, setStaff] = useState([])

    useEffect( 
        () => { 
            fetch(`http://localhost:8088/users?isStaff=true`) 
                .then(response => response.json())
                .then((staffArray) => { 
                    setStaff(staffArray)
                })
        }
    )



    return ( 
        <>
            <h2>Our Staff</h2>

        </>
    )
}
